This data table provides county-level information. It is a daily snapshot in time that focuses on recent COVID-19 outcomes in the last seven days and changes relative to the week prior. Data in this report may differ from data on state and local websites. This may be due to differences in how data were reported (e.g., date specimen obtained, or date reported for cases) or how the metrics are calculated. Historical data may be updated over time due to delayed reporting.", "Archive Repository": "https://healthdata.gov/d/pcq6-asfs", "Contact Email": "HealthData@hhs.gov", "Contact Name": "HealthData.gov Team", "Update Frequency": "R/P3.5D", "Program Code": "009:028", "Publisher": "U.S. Department of Health & Human Services", "Is Quality Data": "true", "Bureau Code": "009:00", "Public Access Level": "public"}

